import { Route, Switch, Redirect } from 'react-router-dom';
import Products from './components/Shop/Products';

// import AllQuotes from './pages/AllQuotes';

function App() {
  return (
    <Layout>
      <Switch>
        <Route path='/' exact>
          <Redirect to='/quotes' />
        </Route>
        <Route path='/quotes' exact>
          <Products />
        </Route>
      </Switch>
    </Layout>
  );
}

export default App;
